<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <div class="center">
    <table border="1">
        <tr>
            <td>
                <marquee width="100%"  direction="left">
                      <img src="data:image/png;base64," alt="">
                </marquee>
              
            </td>
            <td>
                <marquee width="100%"  direction="up">
                      <img src="data:image/png;base64," alt="">
                </marquee>
              
            </td>
        </tr>
        <tr>
            <td>
                <marquee width="100%"  direction="down">
                      <img src="data:image/png;base64," alt="">
                </marquee>
              
            </td>
            <td>
                <marquee width="100%" behavior="alternate" >
                      <img src="data:image/png;base64," width="100px" alt="">
                </marquee>
              
            </td>
        </tr>
    </table>
    </div>
   
</body>
</html>